                    svg += '<line x1="' + sx.toFixed(2) + '" y1="' + padT + '" x2="' + sx.toFixed(2) + '" y2="' + (padT + plotH) + '" stroke="#b22222" stroke-width="1" stroke-dasharray="3 2"/>';
                    svg += '<circle cx="' + sx.toFixed(2) + '" cy="' + sy.toFixed(2) + '" r="3" fill="#b22222"/>';
                }
            }
            if (path) svg += '<path d="' + path + '" fill="none" stroke="#2c3e50" stroke-width="1.5"/>';
            svg += '</svg>';
            return svg;
        }

        function bindClickPopup() {
            if (rasterClickMode !== 'server') return;
            map.on('click', function(e) {
                var activeHourly = null;
                for (var i = 0; i < hourlyRasterLayers.length; i++) {
                    if (map.hasLayer(hourlyRasterLayers[i].layer)) { activeHourly = hourlyRasterLayers[i]; break; }
                }
                if (activeHourly) {
                    fetchTimeseriesAllDays(activeHourly.scenario_folder || '.', activeHourly.var_name || '', e.latlng)
                        .then(function(resp) {
                            if (!resp || !resp.values) { showServerError(); return; }
                            var unit = activeHourly.unit || '';
                            var bands = (activeHourly.var_name === 'UTCI') ? utciBands : [];
                            var dayMeta = resp.dayMeta || null;
                            var chartW = popupChartWidth();
                            var chartSvg = renderTimeseriesSvg(resp.values, chartW, 160, unit, bands, dayMeta, currentIndex);
                            var noDataMsg = chartSvg
                                ? ''
                                : '<div style="padding:6px 4px; color:#666;">Nessun valore valido per il punto selezionato.</div>';
                            var selectedLabel = timelineLabels[currentIndex] || (labelDateCompact(currentDateCompact) + ' ' + pad2(currentHour) + ':00');
                            var selectedVal = (currentIndex >= 0 && currentIndex < resp.values.length) ? resp.values[currentIndex] : null;
                            var selectedValTxt = (selectedVal === null || selectedVal === undefined || isNaN(selectedVal))
                                ? 'n/a'
                                : (Number(selectedVal).toFixed(1) + (unit ? (' ' + unit) : ''));
                            var metricName = activeHourly.var_name || activeHourly.name || 'Value';
                            var html = '<div style="font-size:13px; width:' + chartW + 'px; max-width:calc(100vw - 48px); min-width:0; overflow:hidden;">' +
                                       '<div style="font-weight:700; margin-bottom:6px;">' + metricName + ' at ' + selectedLabel + ': ' + selectedValTxt + '</div>' +
                                       (chartSvg || noDataMsg) +
                                       '</div>';
                            L.popup({maxWidth: chartW + 40})
                                .setLatLng(e.latlng)
                                .setContent(html)
                                .openOn(map);
                        });
                    return;
                }
            });
        }

        var slider = document.getElementById('hour-slider');
        if (slider) slider.addEventListener('input', function(e) { updateRasterHour(parseInt(e.target.value)); });
        var opSlider = document.getElementById('opacity-slider');
        if (opSlider) {
            opSlider.addEventListener('input', function(e) { updateRasterOpacity(parseFloat(e.target.value)); });
            updateRasterOpacity(parseFloat(opSlider.value));
        }
        var hideBtn = document.getElementById('raster-hide-all');
        if (hideBtn) hideBtn.addEventListener('click', function() { hideAllOverlays(); });
        map.on('overlayadd', function() { updateRasterHour(currentIndex); });
        map.on('overlayremove', function() { updateRasterHour(currentIndex); });

        updateRasterHour(0);
        renderRasterColorbars();
        bindClickPopup();
    });
